import React, {Component} from 'react';
import axios from 'axios';
import Cuisine from './cuisine'
import './App.css';



class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      meal: {}
    }
  }

  render() {
      var  data = this.state.meal;
      return (
        <div className="jumbotron jumbotron-billboard text-center">

        <div class="img"></div>
	<div class="container pt">
		<div class="text-center">
			<h1 style={{color:'white', textAlign:'center', fontWeight:'bolder'}}> Restaurant Application  </h1>
		</div>
		<div class="mt-5 text-color">
			<h1>Find the best Restaurants</h1>
		</div>
    <div div class = "row mx-auto well col-lg-12 mt-5" >
    			<div class = "col-xs-4 pr-0">
          				<select id="select_id" class="form-control form-control-lg">
                  	<option value="Select City" hidden>Select City</option>
                    <option value="4">Bengaluru</option>
                    <option value="3" >Mumbai</option>
                    <option value="1">Delhi</option>
                    <option value="6">Hyderabad</option>
                    <option value="5">Pune</option>
                  </select>
          </div>
          			<div div class = "col-xs-6 pl-0 pr-0" >
                				<input id="getText" type="text" class="form-control" placeholder="Search for Restaurant"/>

                </div>

    </div>
    </div>
      <div className="App">
        <div> Restaurant ID </div>
        <div> Restaurant Name </div>
        <div> Cuisines </div>
        <div> Average Cost for Two </div>
        <div> Table Bookings</div>
      </div>
      </div>
    )
  }
}

export default App;
